<!doctype html>
<html lang="en">
  <head>
    <meta charset="UTF-8" />
    <meta name="viewport" content="width=device-width, initial-scale=1.0" />
    <meta http-equiv="X-UA-Compatible" content="ie=edge" />
    <title>Rollup Visualizer</title>
    <style>
      :root {
        --font-family: -apple-system, blinkmacsystemfont, 'Segoe UI', roboto, 'Helvetica Neue', arial, 'Noto Sans',
          sans-serif, 'Apple Color Emoji', 'Segoe UI Emoji', 'Segoe UI Symbol', 'Noto Color Emoji';
        --background-color: #2b2d42;
        --text-color: #edf2f4;
      }

      html {
        box-sizing: border-box;
      }

      *,
      *::before,
      *::after {
        box-sizing: inherit;
      }

      html {
        font-family: var(--font-family);
        color: var(--text-color);
        background-color: var(--background-color);
      }

      body {
        padding: 0;
        margin: 0;
      }

      html,
      body {
        overflow: hidden;
        width: 100%;
        height: 100%;
      }

      body {
        display: flex;
        flex-direction: column;
      }

      svg {
        vertical-align: middle;
        width: 100%;
        height: 100%;
        max-height: 100vh;
      }

      main {
        padding: 20px;
        height: 100vh;
        flex-grow: 1;
      }

      .tooltip {
        position: absolute;
        z-index: 1070;
        padding: 5px;
        font-size: 0.875rem;
        white-space: nowrap;
        color: var(--text-color);
        background-color: var(--background-color);
        border: 2px solid;
        border-radius: 5px;
      }

      .tooltip-hidden {
        opacity: 0;
        visibility: hidden;
      }

      .sidebar {
        position: fixed;
        top: 0;
        right: 0;
        left: 0;
        display: flex;
        align-items: center;
        margin: 0 50px;
        height: 20px;
        font-size: 0.7rem;
        flex-direction: row;
      }

      .size-selectors {
        display: flex;
        flex-direction: row;
        align-items: center;
      }

      .size-selector {
        display: flex;
        justify-content: center;
        align-items: center;
        margin-right: 1rem;
        flex-direction: row;
      }

      .size-selector input {
        margin: 0 0.3rem 0 0;
      }

      .filters {
        flex: 1;
        display: flex;
        flex-direction: row;
        align-items: center;
      }

      .module-filters {
        display: flex;
        flex-grow: 1;
      }

      .module-filter {
        display: flex;
        justify-content: center;
        align-items: center;
        flex-direction: row;
        flex: 1;
      }

      .module-filter input {
        padding: 0.01rem;
        margin-left: 0.3rem;
        height: 1rem;
        font-size: 0.7rem;
        flex: 1;
      }

      .module-filter + .module-filter {
        margin-left: 0.5rem;
      }

      .node {
        cursor: pointer;
      }
    </style>
  </head>
